import styled from 'styled-components'

export const UnregisteredAccountPageWireframeWrapper = styled.div`
  padding: ${({padding}) => padding ? padding : '70px 0 120px 0'};
  position: relative;

  .container {
    padding: 0 12px;
  }
`
